(function($){Drupal.behaviors.getlocations_field_group={attach:function(){if(typeof Drupal.settings.getlocations==='undefined'){return}$.each(Drupal.settings.getlocations,function(key,settings){if(settings.field_group_enable){if($(".multipage-link-next,.multipage-link-previous").is('input')){$(".multipage-link-next,.multipage-link-previous").one('click',function(event){Drupal.getlocations.redoMap(key);if(Drupal.getlocations_data[key].datanum==1){var ll=Drupal.getlocations_data[key].latlons;var ll2=ll[0];Drupal.getlocations_map[key].setCenter({lat:parseFloat(ll2[0]),lng:parseFloat(ll2[1])})}})}if($(".vertical-tabs-list,.horizontal-tabs-list").is('ul')){$("li.vertical-tab-button a, li.horizontal-tab-button a").bind('click',function(event){Drupal.getlocations.redoMap(key);if(Drupal.getlocations_data[key].datanum==1){var ll=Drupal.getlocations_data[key].latlons;var ll2=ll[0];Drupal.getlocations_map[key].setCenter({lat:parseFloat(ll2[0]),lng:parseFloat(ll2[1])})}})}if($(".field-group-accordion, .field-group-accordion-wrapper").is('div')){$(".accordion-item").bind('click',function(event){Drupal.getlocations.redoMap(key);if(Drupal.getlocations_data[key].datanum==1){var ll=Drupal.getlocations_data[key].latlons;var ll2=ll[0];Drupal.getlocations_map[key].setCenter({lat:parseFloat(ll2[0]),lng:parseFloat(ll2[1])})}})}if($(".field-group-format, .field-group-format-wrapper").is('div')){$(".field-group-format-title").one('click',function(event){Drupal.getlocations.redoMap(key);if(Drupal.getlocations_data[key].datanum==1){var ll=Drupal.getlocations_data[key].latlons;var ll2=ll[0];Drupal.getlocations_map[key].setCenter({lat:parseFloat(ll2[0]),lng:parseFloat(ll2[1])})}})}}})}}})(jQuery);